  function fetchNameHandler() {
    fetch('http://127.0.0.1:5000/simulator')
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      return data.results[0];
    })
  }

  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
